var handleLogin=function(){$("#loginForm").on("submit",function(a){if(a.preventDefault(),$(this).parsley({errorsWrapper:'<div class="text-danger"></div>',errorTemplate:"<span></span>"}).validate(),$(this).parsley().isValid()){var e=$(this).serializeArray();e=JSON.stringify(e),$.ajax({type:"GET",url:"data/login.json",data:e,beforeSend:function(){$(".alert").remove()},success:function(a){if(a.isSuccess)location.assign("http://localhost:3000/dashboard.html");else{var e=alertBox("danger","Wrong username or password!");$(".modal-body").prepend(e),$("#password").val(""),$("#email").val("")}},complete:function(){$(".alert").fadeOut(5e3)}})}})};function alertBox(a,e){var r="";return r+='<div class="alert alert-'+a+' fade show text-center" role="alert">',r+=e,r+="</div>"}var App={init:function(){handleLogin()}};